import  ReactDOM  from 'react-dom';
import "./index.css"
import Nav from './Nav';
import Body from './Body';

function Page(){
    return(
        <div>
            <Nav/>
            <Body/>
        </div>
    )
}

ReactDOM.render(<Page/>,document.getElementById('root'));
